import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000';
const API = `${API_BASE_URL}/api/products`;

console.log('ðŸ›’ ProductService: Initialized with URL:', API);

const productService = {
  getAllProducts: async () => {
    try {
      console.log('ðŸ›’ ProductService: Making request to', API);
      const res = await axios.get(API);
      console.log('ðŸ›’ ProductService: Response received:', {
        status: res.status,
        dataType: typeof res.data,
        dataLength: Array.isArray(res.data) ? res.data.length : 'not array',
        firstItem: Array.isArray(res.data) ? res.data[0] : res.data
      });
      return res.data;
    } catch (error) {
      console.error('ðŸ›’ ProductService: Error details:', {
        message: error.message,
        response: error.response?.data,
        status: error.response?.status,
        url: error.config?.url
      });
      throw error;
    }
  }
};

export default productService;
